import React, { useState } from "react";
import Tippy from '@tippyjs/react/headless';
import styles from './Popped.module.scss'
import SearchOptions from "./searchOptions/searchSuggest";
import SearchResult from "./searchOptions/searchResult";



function Popped({ children, style, onCLickOutSide }) {
    const [searchResult, setSearchResult] = useState([1,2,3])
    const [isShow,setIsShow] = useState(true)

    return (
        <Tippy
            onClickOutside={onCLickOutSide}
            interactive
            placement="top-start"
            visible={searchResult.length > 0}
            render={() => (
                // <div className={styles.wrapper}>
                <div
                 className={`${styles.wrapper} ${style.temp}`} 
                 tabIndex="-1">
                    <h4 className={styles.title}>You may like</h4>
                    <div className={styles.options}>
                        <div className={styles.option}>
                            <SearchOptions content="Đặng Thu Hà mặc váy đỏ gốc đổi đồ" key={1} />
                        </div>
                        <div className={styles.option}>
                            <SearchOptions content={"Hai vợ chồng LGBT ăn cơm clip gốc"} key={2} />
                        </div>
                        <div className={styles.option}>
                            <SearchOptions content={"Đặng Thu Hà"} key={3} />
                        </div>
                        <h4 className={styles.title}>Accounts</h4>
                        <div className={styles.option}>
                            <SearchResult img="https://2sao.vietnamnetjsc.vn/images/2018/11/02/11/06/ca-sy-min-phau-thuat-tham-my-01.jpg" name="Min" account="MinMin16" />
                        </div>
                        <div className={styles.option}>
                            <SearchResult img="https://p16-sign-useast2a.tiktokcdn.com/tos-useast2a-avt-0068-giso/33fd8341eec3c69dc34972b27738b860~c5_300x300.webp?x-expires=1689408000&x-signature=PJhciEIJlV%2FcF%2BZwJD4YHQOkUq0%3D" name="Thanh Mèo" account="thanhmeo.18" />
                        </div>
                        <div className={styles.option}>
                            <SearchResult img="https://p16-sign-va.tiktokcdn.com/tos-maliva-avt-0068/42a81079b5885e152707b170d63ba2df~c5_100x100.jpeg?x-expires=1689408000&x-signature=FP6lkvsOCuoPC8EFefvJ3fTf34g%3D" name="Đào Lê Phương" account="thanhmeo.18" />
                        </div>
                    </div>
                </div>
                // </div>
            )}
        >
            {children}
        </Tippy>
    )
}

export default Popped;
